  return (
    <div>
      <p style={{ textAlign: "center" }}>
        startフォルダの内容が表示されます。
        <br />
        練習用に使ってください！
      </p>
      <label htmlFor="456">ラベル</label>
      <div>
        <input
          id="123"
          placeholder=""
        />
      </div>
    </div>
  );
};

